import React from "react";
import { useAuth0 } from "@auth0/auth0-react";
import {Image} from 'react-bootstrap'

const Profile = () => {
    const { user, isAuthenticated } = useAuth0();
    return (
        isAuthenticated && (
            <div>
                <p style={{ fontSize: '18px', fontStyle: 'italic', justifyContent: 'center', fontWeight: '' }}>{user.name}</p>
                <p style={{ fontSize: '12px', fontStyle: 'italic', justifyContent: 'center' }}>{user.email}</p>
                <Image src={user.picture} alt={user.name} style={{ width: '40px' }} />
            </div>
        )
    )
}

export default Profile;
